import { Outlet, Link } from "react-router-dom";

const linkStyle = {};

export default function Layout() {
  return (
    <nav>
      <ul>
        <li
          style={{
            display: "inline-block",
            listStyleType: "none",
            padding: 0,
            margin: 0,
            marginLeft: -20,
          }}
        >
          <Link
            to={"/"}
            style={{
              textDecoration: "none",
              border: "solid black 1px",
              padding: 10,
              color: "black",
              fontWeight: 200,
            }}
          >
            Tic-Tac-Toe
          </Link>
        </li>
        <li style={{ display: "inline-block", marginLeft: 10 }}>
          <Link to={"/calc"}>Calculator</Link>
        </li>
      </ul>
      <Outlet></Outlet>
    </nav>
  );
}
